import React, { Component } from "react";
import axios from "axios";
import Grid from "@material-ui/core/Grid";

import Hum from "../components/Ability";

export class home extends Component {
  state = {
    hums: null,
  };
  componentDidMount() {
    axios
      .get("/Hums")
      .then((res) => {
        console.log(res.data);
        this.setState({
          hums: res.data,
        });
      })
      .catch((err) => console.log(err));
  }
  render() {
    let recentHumsMarkup = this.state.hums ? (
      this.state.hums.map((hum) => <Hum hum={hum} />)
    ) : (
      <p>Loading...</p>
    );
    return (
      <Grid container spacing={10}>
        <Grid item sm={8} xs={12}>
          {recentHumsMarkup}
        </Grid>
        <Grid item sm={4} xs={12}>
          <p>Profile....</p>
        </Grid>
      </Grid>
    );
  }
}

export default home;
